import React, { useEffect, useState } from "react";

const App = () => {
  const [count, setCount] = useState(0);
  useEffect(() => {
    alert(`Hii clicked ${count} time`);
  });

  return (
    <>
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        Click Me {count}
      </button>
    </>
  );
};

export default App;
